/*Table structure for table `monitor_tag` */

DROP TABLE IF EXISTS `monitor_tag`;

CREATE TABLE `monitor_tag` (
  `id` varchar(32) NOT NULL,
  `tag_code` varchar(32) NOT NULL COMMENT '节点编号',
  `tag_name` varchar(64) NOT NULL COMMENT '节点名称',
  `obj_type` varchar(32) DEFAULT NULL COMMENT '对象类型',
  `obj_type_name` varchar(32) DEFAULT NULL,
  `obj_group_id` varchar(255) DEFAULT NULL COMMENT '对象组',
  `obj_id` varchar(64) DEFAULT NULL COMMENT '监控对象',
  `type` char(1) DEFAULT NULL COMMENT 'G 对象组 O 对象',
  `value_type` varchar(32) DEFAULT NULL COMMENT '值类型',
  `enabled` int(1) DEFAULT NULL COMMENT '0 不启用 1启用',
  `create_user` varchar(32) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_user` varchar(32) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `del_flag` char(1) DEFAULT '0',
  `remarks` varchar(600) DEFAULT NULL COMMENT '描述',
  PRIMARY KEY (`tag_code`,`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

